import Layout from '../components/Layout';
import Image from 'next/image';
import { about } from '../styles.module.css';

const About = () => (
  <Layout>
    <div className={about}>
      <div>
        <Image
            alt="climbing-quote icon"
            src="/climbing-quote.png"
            layout="intrinsic"
            width={1000}
            height={575}
            />
        </div>
    </div>
  </Layout>
  );

  export default About;
